export const styles = theme => ({
    root: {
        background: `${theme.palette.white.main} `,
        borderRadius: "16px ",
        boxShadow: "none ",
        color: `${theme.palette.text.primary} `,
        fontFamily: theme.font.semibold,
        fontSize: "14px ",
        height: "40px ",
        minWidth: "120px ",
        textTransform: "none ",
    },
    sizeLarge: {
        height: theme.spacing(7),
        fontSize: "16px ",
    },
    sizeSmall: {
        borderRadius: "8px ",
        height: "32px ",
        padding: `${theme.spacing(1) / 2}px ${2 * theme.spacing(1)}px `,
    },
    disabled: {
        background: `${theme.palette.text.disabled} `,
        color: `${theme.palette.text.secondary} `,
    },
    containedPrimary: {
        background: `${theme.palette.success.main} `,
        color: `${theme.palette.white.main} `,
        [theme.breakpoints.between("xs", "md")]: {
            "&:hover": { background: `${theme.palette.success.main} ` },
        },
        [theme.breakpoints.between("md", "xl")]: {
            "&:hover": { background: `${theme.palette.success.hover} ` },
        },
    },
    textPrimary: {
        fontFamily: theme.font.semibold,
        "&:hover": { background: "none " },
    },
    containedSecondary: {
        background: `${theme.palette.secondary.main} `,
        color: `${theme.palette.secondary.contrastText} `,
        [theme.breakpoints.between("xs", "md")]: {
            "&:hover": { background: `${theme.palette.secondary.main} ` },
        },
        [theme.breakpoints.between("md", "xl")]: {
            "&:hover": { background: `${theme.palette.secondary.light} ` },
        },
    },
    outlinedPrimary: {
        background: "transparent",
        borderColor: `${theme.palette.primary.main} `,
        color: `${theme.palette.primary.main} `,
        [theme.breakpoints.between("xs", "md")]: {
            "&:hover": {
                background: "transparent",
                borderColor: `${theme.palette.primary.main} `,
            },
        },
        [theme.breakpoints.between("md", "xl")]: {
            "&:hover": {
                background: `${theme.palette.primary.lighter} `,
                borderColor: `${theme.palette.primary.main} `,
            },
        },
    },
    outlinedSecondary: {
        background: "transparent",
        borderColor: `${theme.palette.secondary.main} `,
        color: `${theme.palette.secondary.main} `,
        [theme.breakpoints.between("xs", "md")]: {
            "&:hover": {
                background: "transparent",
                borderColor: `${theme.palette.secondary.main} `,
            },
        },
        [theme.breakpoints.between("md", "xl")]: {
            "&:hover": {
                background: `${theme.palette.secondary.lighter} `,
                borderColor: `${theme.palette.secondary.main} `,
            },
        },
    },
    grouped1: {
        borderTopRightRadius: "0 ",
        borderBottomRightRadius: "0 ",
    },
    grouped2: {
        borderTopLeftRadius: "0 ",
        borderBottomLeftRadius: "0 ",
        borderLeft: `1px solid ${theme.palette.secondary.dark} `,
    },
    addRemovePrimary: {
        background: `${theme.palette.white.main} `,
        borderColor: `${theme.palette.primary.main} `,
        borderRadius: "100% ",
        color: `${theme.palette.primary.main} `,
        height: "28px ",
        minWidth: "0 ",
        padding: "0 ",
        width: "28px ",
        "&:hover": {
            background: `${theme.palette.primary.lighter} `,
            borderColor: `${theme.palette.primary.main} `,
            color: `${theme.palette.primary.main} `,
        },
    },
    addRemoveSecondary: {
        background: `${theme.palette.white.main} `,
        borderColor: "transparent ",
        borderRadius: "100% ",
        color: `${theme.palette.primary.main} `,
        height: "30px ",
        minWidth: "0 ",
        padding: "0 ",
        width: "30px ",
        "&:hover": {
            background: `${theme.palette.white.main} `,
            borderColor: "transparent ",
            color: `${theme.palette.primary.main} `,
        },
    },
    nextPrev: {
        border: "none ",
        borderRadius: "16px ",
        boxShadow: `${theme.shadows[24]} `,
        color: `${theme.palette.text.primary} `,
        height: "40px ",
        minWidth: "40px ",
        padding: "0 ",
        "&:hover": {
            background: "none ",
            border: "none ",
            color: `${theme.palette.text.primary} `,
        },
    },
    play: {
        background: `${theme.palette.text.primary} `,
        borderRadius: "100% ",
        color: `${theme.palette.white.main} `,
        height: "48px ",
        minWidth: "0 ",
        width: "48px ",
        "&:hover": { background: `${theme.palette.text.primary} ` },
    },
    before: {
        marginLeft: theme.spacing(1),
    },
    after: {
        marginRight: theme.spacing(1),
    },
});
